import React from "react";
import Hero from "../Components/Hero";
import GamesWePlay from "../Components/GamesWePlay";
import AboutUs from "../Components/AboutUs";

const HomePage = () => {
  return (
    <>
      <Hero />
      <GamesWePlay />
      <AboutUs />
    </>
  );
};

export default HomePage;
